B.KZ=new A.ev("umore","uMore | AI-Powered mental well-being tracker","UX/ UI Design","This was my first job in a startup were I worked as a Product Designer and I played a key role in shaping the user experience to ensure the product was usable, enjoyable, and accessible.\n\nIn the early stages, I conducted a thorough audit of the app, provided UX/UI feedback, implemented daily check-in reminder notifications, and define the brand color palette. A crucial part of this was ensuring the palette met accessibility standards for a new feature launch.\n\nLater, I focused on the \u201cBuddies\u201d feature, designing user interactions around sharing mood-based \u201cstories\u201d and enabling preset message exchanges, which enhanced user engagement and connection.\n\nOne of my most challenging and rewarding tasks was leading the creation of a comprehensive Design System. This collaborative effort involved working closely with the Product team using agile methodologies to ensure consistency and scalability.\n\nI also occasionally partnered with UX research to test new features and develop user personas, ensuring our designs were informed by user needs and behaviors.\n          ","cover.webp",B.lx,B.H0,B.lv,B.Gj,!1)
